  Switch,
  Route,
  Link
} from "react-router-dom";


export default class App extends Component {

  render() {
    return (
      <div>
      <Router>
    <Navbar/>
    <News pageSize={5} newsKey='6ebc2a61e4214ddebacf3db11107688e' category="science" setCountry="in"/>
    </Router>
      </div>
    )
  }
}
